import React from 'react';
import NB from './NavBar/NB';
import './index.css';
import Price from './price/infoprice';
import PB from './PromoBlock/PB';
import { useState } from 'react';

function App() {
  let [forward, setForward] = useState(false);
  function setParentValue(value) {
    setForward(value)
  }
  if (forward) {
    return (
    <div>
      <NB state={setParentValue} />
    </div>
    );
  } else {
    return (
      <div>
        <button onClick={() => setForward(false)}></button>
      </div>
    )
  }
}
export default App;
